import React from 'react';
import './ap.css';

function Navigation () {
    return (
        <nav className='navigation'>
            <h1 className='navigation-logo'>Vet Track</h1>
            <ul className='navigation-links'>
            <li><a href='home'>Home</a></li>

            </ul>
        </nav>
    )

}


export default Navigation;
